import React from "react";
import "./header.component.css";

const Header = (props) => {
  let menu = props.isLoggedIn ? (
    <ul className="nav_list">
      <li>Home</li>
      <li>Profile</li>
      <li>Logout</li>
    </ul>
  ) : (
    <ul className="nav_list">
      <li>Home</li>
      <li>Login</li>
      <li>Register</li>
    </ul>
  );
  return (
    <div className="nav_bar">
       {menu}
    </div>
  );
};

export default Header;
